import mc from "./home.module.scss";
//components//
import NavBar from "../nav-bar/NavBar";
import Main from "../main/Main";

const Home = () => {
  return (
    <div className={mc.container}>
      <nav>
        <NavBar />
      </nav>
      <main>
        <Main />
      </main>
    </div>
  );
};

export default Home;
